import React from "react";
import Home from "./components/home/Home";
import Navbar from "./components/navbar/Navbar";
import './index.css';
import Footer from "./components/footer/Footer";
import Particles from "./Particles";



function App() {
  return (
    <div className="App">
      <Particles/>
      <Navbar/>
      <Home/>
      <Footer/>
    </div>
  );
}

export default App;
